import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HeaderComponent from './components/HeaderComponent';
import FooterComponent from './components/FooterComponent';
import ListEmployeeComponent from './components/Employee/ListEmployeeComponent';
import LoginComponent from './components/LoginComponent';
import CreateEmployeeComponent from './components/Employee/CreateEmployeeComponent';
import ViewEmployeeComponent from './components/Employee/ViewEmployeeComponent';
import ListDepartmentComponent from './components/Department/ListDepartmentComponent'; // Import the new component


function App() {
  return (
    <div>
      <Router>
        <HeaderComponent />
        <div className="container">
          <Routes>
            <Route path="/" element={<LoginComponent />} />
            <Route path = "/employees" element = {<ListEmployeeComponent />}></Route>
            <Route path = "/add-employee/:id" element = {<CreateEmployeeComponent />}></Route>
            <Route path = "/view-employee/:id" element = {<ViewEmployeeComponent/>}></Route>
            <Route path="/departments" element={<ListDepartmentComponent />} />
          </Routes>
        </div>
        <FooterComponent />
      </Router>
    </div>
  );
}

export default App;
